import styled from "styled-components";
import { Logo } from "../../components/logo/Logo";

export function Footer() {
	return (
		<StyledFooter>
			<Logo/>
		</StyledFooter>
	);
}

const StyledFooter = styled.section`
background-color: #6a726a;
`;
